import React, { Component } from 'react';
import { Button } from './styles/HomePage'

class HomePage extends Component {
  render() { 
    return (
      <>
        <Button>
          HOME
        </Button>
        <Button>
          LOGIN
        </Button>
        <Button>
          HELP-CENTER
        </Button>
        <Button>
          CONTACT US
        </Button>
        </>
      )
  }
}

export default HomePage;
